import UserCard from "./components/card/UserCard";

const users = [
  { name: "Андрій", age: 25, city: "Київ" },
  { name: "Ольга", age: 30, city: "Львів" },
  { name: "Максим", age: 22, city: "Одеса" }
];

function App() {
  return (
    <div>
      {users.map((user, index) => (
        <UserCard key={index} {...user} />
      ))}
    </div>
  );
}

export default App;
